pragma solidity >=0.6.0 <0.8.0;
// pragma experimental ABIEncoderV2;
/*
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v3.4.0/contracts/access/Ownable.sol"; // @ [import: Context]
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v3.4.0/contracts/access/AccessControl.sol"; // @ [import: Address, Context]
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v3.4.0/contracts/token/ERC721/ERC721.sol"; // @ [import: Address, Context, Strings, SafeMath]
